import './Header.css'
import styled from "styled-components";

function Header() {
  return (
    <HeaderWrap>
        <Logo src={require('../../images/LogoWhite.png')}/>
        <SearchBox/>
    </HeaderWrap>
  );
}

const HeaderWrap = styled.div`
    display: flex;
    height: 50px;
    width: 100%;
    background-color: black;
    padding: 10px;
`;

const Logo = styled.img`
    height: 35px;
    margin-top: 12px;
`;

const SearchBox = styled.input`
    width: 400px;
`

export default Header;
